import React from "react"
import './App.css'

export default function Tourblock() {
  return (
    <div className="container-block-tour">
      <h1 className="container-block-tour-title">TOUR</h1>
        <ul className="tour-list">
          <li>NO CURRENT TOUR DATES</li>
        </ul>
    </div>
  )
}
